export default class STATE extends Component {

constructor(props) {
    super(props)

    this.state = {
         count :0
    }
}




    render() {
        const {count}=this.state
        return (
            <div>
               
               <h1>Count:{count}</h1>
               <button>+</button>
            </div>
        )
    }
}
